from pybricks.hubs import PrimeHub
from pybricks.parameters import Direction, Port, Stop
from pybricks.pupdevices import Motor
from pybricks.robotics import DriveBase

# Set up all devices.
prime_hub = PrimeHub()
right_motor = Motor(Port.A, Direction.COUNTERCLOCKWISE)
left_motor = Motor(Port.B, Direction.CLOCKWISE)
front_motor = Motor(Port.E, Direction.CLOCKWISE)
top_motor = Motor(Port.F, Direction.COUNTERCLOCKWISE)
drive_base = DriveBase(left_motor, right_motor, 81.6, 114)


# The main program starts here.
drive_base.curve(-100, -33, Stop.NONE)
drive_base.straight(-250)
drive_base.curve(-300, 100)
drive_base.curve(-316, -59)
# completed mission 15, research vessel
drive_base.curve(400, -60, Stop.NONE)
drive_base.turn(60, Stop.NONE)
drive_base.straight(-250, Stop.NONE)
drive_base.settings(straight_acceleration=1000)
drive_base.settings(straight_speed=1000)
drive_base.curve(-400, 40, Stop.NONE)
drive_base.straight(-630)
